import{_ as e,c as a,o,a4 as t}from"./chunks/framework.uQk9_EO2.js";const i="/docs/cocos/assets/ios-build-options.BdnKV3Ih.png",_=JSON.parse('{"title":"iOS 平台构建选项","description":"","frontmatter":{},"headers":[],"relativePath":"zh/editor/publish/ios/build-options-ios.md","filePath":"zh/editor/publish/ios/build-options-ios.md","lastUpdated":1712305443000}'),r={name:"zh/editor/publish/ios/build-options-ios.md"},d=t('<h1 id="ios-平台构建选项" tabindex="-1">iOS 平台构建选项 <a class="header-anchor" href="#ios-平台构建选项" aria-label="Permalink to &quot;iOS 平台构建选项&quot;">​</a></h1><p><img src="'+i+'" alt="ios-build-options"></p><h2 id="配置选项" tabindex="-1">配置选项 <a class="header-anchor" href="#配置选项" aria-label="Permalink to &quot;配置选项&quot;">​</a></h2><h3 id="可执行文件名" tabindex="-1">可执行文件名 <a class="header-anchor" href="#可执行文件名" aria-label="Permalink to &quot;可执行文件名&quot;">​</a></h3><p>用于指定应用程序主执行文件名称的字段，这个字段被存储在应用的 Info.plist 文件中。如果未填写，系统将根据应用名称字段生成默认值。值的设定只能包含数字、字母、下划线(_)以及减号(-)。</p><h3 id="应用-id-名称-bundle-identifier" tabindex="-1">应用 ID 名称（Bundle Identifier） <a class="header-anchor" href="#应用-id-名称-bundle-identifier" aria-label="Permalink to &quot;应用 ID 名称（Bundle Identifier）&quot;">​</a></h3><p>包名，通常以产品网站 URL 倒序排列，如 <code>com.mycompany.myproduct</code>。</p><blockquote><p><strong>注意</strong>：包名中只能包含数字（0~9）、字母（A~Z、a~z）、中划线（-）和点（.），此外包名最后一部分必须以字母开头，不能以下划线或数字开头。详情请参考 <a href="https://developer.apple.com/documentation/bundleresources/information_property_list/cfbundleidentifier" target="_blank" rel="noreferrer">包的唯一标识符</a>。</p></blockquote><h3 id="跳过-xcode-工程的更新" tabindex="-1">跳过 Xcode 工程的更新 <a class="header-anchor" href="#跳过-xcode-工程的更新" aria-label="Permalink to &quot;跳过 Xcode 工程的更新&quot;">​</a></h3><p>在默认情况下，每次构建都会执行 CMake 命令以生成 Xcode 工程。然而，如果对生成的 Xcode 工程进行了修改或配置，例如通过 CocoaPods 集成了 SDK，这可能会引起问题，因为这些修改在下次构建时会被还原。</p><p>如果选中这个选项，后续的构建将不再更新或覆盖 Xcode 工程的配置。</p><p>要注意的是，与 CMake 相关的其他修改，例如添加C++源代码，也不会再触发 Xcode 工程的重新生成。</p><h3 id="屏幕方向" tabindex="-1">屏幕方向 <a class="header-anchor" href="#屏幕方向" aria-label="Permalink to &quot;屏幕方向&quot;">​</a></h3><p>屏幕方向目前包括 Portrait、Landscape Left、Landscape Right 三种。</p><ul><li>Portrait：屏幕直立，Home 键在下</li><li>Landscape Left：屏幕横置，Home 键在屏幕左侧</li><li>Landscape Right：屏幕横置，Home 键在屏幕右侧</li></ul><h3 id="目标系统" tabindex="-1">目标系统 <a class="header-anchor" href="#目标系统" aria-label="Permalink to &quot;目标系统&quot;">​</a></h3><p>默认启动的系统类型：</p><ul><li>iPhone OS: 真机运行。</li><li>iOS Simulator: iOS 模拟运行。</li></ul><p>这个只是默认值，可以在 Xcode 中随时修改。</p><h3 id="渲染后端" tabindex="-1">渲染后端 <a class="header-anchor" href="#渲染后端" aria-label="Permalink to &quot;渲染后端&quot;">​</a></h3><p><strong>渲染后端</strong> 目前支持 <strong>METAL</strong>，详情可参考官方文档 <a href="https://developer.apple.com/cn/metal/" target="_blank" rel="noreferrer">Metal</a>。</p><h3 id="开发者" tabindex="-1">开发者 <a class="header-anchor" href="#开发者" aria-label="Permalink to &quot;开发者&quot;">​</a></h3><p>该项用于配置构建编译 iOS 工程时的 Development Team 签名信息。若使用 Xcode 编译时，在 Xcode 中手动配置了签名信息，则以 Xcode 中的配置为准。当执行重新构建时，该项的值会覆盖 Xcode 中配置的值。</p><h3 id="目标版本" tabindex="-1">目标版本 <a class="header-anchor" href="#目标版本" aria-label="Permalink to &quot;目标版本&quot;">​</a></h3><p>该项主要用于指定发布 iOS 平台时的 iOS 软件版本，默认值为 <strong>12.0</strong>。构建后版本号会记录在发布包目录 <code>proj/cfg.cmake</code> 文件的 <code>TARGET_IOS_VERSION</code> 字段中。</p>',25),l=[d];function n(s,c,h,p,u,b){return o(),a("div",null,l)}const f=e(r,[["render",n]]);export{_ as __pageData,f as default};
